const spreadsheetId = $('Set Variables').first().json.spreadsheetId;
const dateToday = $('Set Variables').first().json.date_today;
const fileInfo = $json;

// Extract domain from spreadsheet name (format: "SEO Audit - domain.com - date" or similar)
const name = fileInfo.name || '';
let domain = '';

// Try to extract domain from name
const domainMatch = name.match(/[-–—]\s*([a-zA-Z0-9][a-zA-Z0-9-]*\.[a-zA-Z]{2,})\s*[-–—]/)
  || name.match(/([a-zA-Z0-9][a-zA-Z0-9-]*\.[a-zA-Z]{2,})/);
if (domainMatch) {
  domain = domainMatch[1];
}

// Get parent folder ID
const folderId = fileInfo.parents?.[0] || '';

return [{
  json: {
    spreadsheetId,
    domain,
    folderId,
    dateToday,
    spreadsheetName: name
  }
}];

const domain = $('Extract Domain & Folder').first().json.domain;
const spreadsheetId = $('Extract Domain & Folder').first().json.spreadsheetId;
const folderId = $('Extract Domain & Folder').first().json.folderId;
const dateToday = $('Extract Domain & Folder').first().json.dateToday;

const valueRanges = $json.valueRanges || [];

function parseSheet(values) {
  if (!values || values.length < 2) return { headers: [], rows: [], stats: {} };
  const headers = values[0];
  const rows = values.slice(1);
  return { headers, rows, count: rows.length };
}

function chunkArray(arr, size) {
  const chunks = [];
  for (let i = 0; i < arr.length; i += size) {
    chunks.push(arr.slice(i, i + size));
  }
  return chunks;
}

function summarizeData(data, topN = 100) {
  const top = data.rows.slice(0, topN);
  const stats = {
    totalRows: data.rows.length,
    headers: data.headers
  };
  return { top, stats, headers: data.headers };
}

// Parse all 6 sheets
const sheets = {
  organic: parseSheet(valueRanges[0]?.values),
  linkProfile: parseSheet(valueRanges[1]?.values),
  topPagesByLinks: parseSheet(valueRanges[2]?.values),
  behavioral: parseSheet(valueRanges[3]?.values),
  keywords: parseSheet(valueRanges[4]?.values),
  trafficPages: parseSheet(valueRanges[5]?.values)
};

// Prepare data for each agent
const agent1Data = {
  name: 'Органічний трафік',
  data: summarizeData(sheets.organic, 50)
};

const agent2Data = {
  name: 'Посилальний профіль',
  data: summarizeData(sheets.linkProfile, 50)
};

const agent3Data = {
  name: 'Топ сторінки за посиланнями',
  data: summarizeData(sheets.topPagesByLinks, 100)
};

const agent4Data = {
  name: 'Поведінкові метрики',
  data: summarizeData(sheets.behavioral, 50)
};

// Keywords - chunk by 500 if large
const keywordsChunks = sheets.keywords.rows.length > 500 
  ? chunkArray(sheets.keywords.rows, 500).slice(0, 3) // Max 3 chunks for cost
  : [sheets.keywords.rows];

const agent5Data = {
  name: 'Ключові фрази',
  data: {
    headers: sheets.keywords.headers,
    chunks: keywordsChunks.map((chunk, i) => ({
      chunkNum: i + 1,
      totalChunks: keywordsChunks.length,
      rows: chunk.slice(0, 200) // Limit each chunk
    })),
    stats: {
      totalKeywords: sheets.keywords.rows.length
    }
  }
};

const agent6Data = {
  name: 'Трафікогенеруючі сторінки',
  data: summarizeData(sheets.trafficPages, 100)
};

return [{
  json: {
    domain,
    spreadsheetId,
    folderId,
    dateToday,
    agent1Data,
    agent2Data,
    agent3Data,
    agent4Data,
    agent5Data,
    agent6Data
  }
}];

const items = $input.all();

const domain = $('Extract Domain & Folder').first().json.domain;
const dateToday = $('Extract Domain & Folder').first().json.dateToday || $('Extract Domain & Folder').first().json.date_today;
const folderId = $('Extract Domain & Folder').first().json.folderId;
const spreadsheetId = $('Extract Domain & Folder').first().json.spreadsheetId;

// Collect all agent responses - items arrive in order by input index (0-5)
const sections = [];
for (const item of items) {
  const content = item.json.message?.content || item.json.content || item.json.text || item.json.output || '';
  sections.push(content);
}

// Ensure we have exactly 6 sections
while (sections.length < 6) {
  sections.push('[Дані відсутні]');
}

return [{
  json: {
    domain,
    dateToday,
    folderId,
    spreadsheetId,
    section1: sections[0],
    section2: sections[1],
    section3: sections[2],
    section4: sections[3],
    section5: sections[4],
    section6: sections[5],
    sectionsCount: items.length,
    allSections: sections.filter(s => s && s !== '[Дані відсутні]').join('\n\n---\n\n')
  }
}];

